@carro [τ, ∆] - manifold labs 

> it would take a long time to get the amount of sn tokens that I would have from the initial creation
I hear you and we are thankful for your concerns as they are helping us design the system to be positive for all builders, especially Manifold labs. Furthermore, we are 1) working on ways to allow subnet owners to dissolve and 2) ways for them to keep their subnets without executing DTAO (an extension) and 3) regarding locks, because of the way subnets are initialized, 50% of locks can be removed * first day* through the pools and over a very short period the entire lock can be removed via coinbase emission.  Happy to expand on all of these points/

the key point is, using Polkadot's Substrate sdk building a standalone chain to support Bittensor's grand goal ---- Decentralized AI system, seems not achievable.

1) Opentensor foundation controls the chain;
2) Substrate framework lacks functionality (limited smart contract capabilities) and has low scalability (other public chains like Solana are far ahead).
